  false,\n\t\"url\": null,\n\t\"notes\": \"Single-beam bathymetry, gravity, and magnetic
  data along with transit satellite navigation data was collected as part of field
  activity UGEOLEG_3 (U-3-71-CB) in Eastern Greater Antilles, Caribbean from 07/17/1971
  to 08/04/1971, http://walrus.wr.usgs.gov/infobank/u/u371cb/html/u-3-71-cb.meta.html
  The geophysical source was a Knudsen 12 kHz 320B/R echosounder. These data are reformatted
  from space-delimited ASCII text files located in the Coastal and Marine Geology
  Program (CMGP) InfoBank field activity catalog at http://walrus.wr.usgs.gov/infobank/u/u371cb/html/u-3-71-cb.bath.html
  http://walrus.wr.usgs.gov/infobank/u/u371cb/html/u-3-71-cb.grav.html and http://walrus.wr.usgs.gov/infobank/u/u371cb/html/u-3-71-cb.mag.html
  into MGD77T format provided by the NOAA's National Geophysical Data Center(NGDC).
  The MGD77T format includes a header (documentation) file (.h77t) and a data file
  (.m77t). More information regarding this format can be found in the publication
  listed in the Cross_reference section of this metadata file.\",\n\t\"license_title\":
